import React from 'react'
import Tile from './Tile'


export default class Portfolio extends React.Component {
  constructor(){
    super()
    this.state = {
      project: ['TTT', 'EMA', 'Portfolio' ]
    }
  }
  render() {
    return (
        <div className='grid'>
          {this.state.project.map(proj => {
            <Tile title = {proj}/>
          })}
        </div>
    )
  }
}
